    str2 = ''.join(filter(str.isalpha, str2)).lower()
    count1 = {}
    count2 = {}
    for char in str1:
        count1[char] = count1.get(char, 0) - 1
    for char in str2:
        count2[char] = count2.get(char, 0) + 1
    common_chars = {}
